    21→  const loadSessions = async () => {
    22→    try {
    23→      const { data: { user } } = await supabase.auth.getUser();
    24→      if (!user) {
    25→        setLoading(false);
    26→        return;
    27→      }
    28→
    29→      // Fetch from new sessions table
    30→      const { data: sessionsData, error: sessionsError } = await supabase
    31→        .from('sessions')
    32→        .select('*')
    33→        .eq('user_id', user.id)
    34→        .order('created_at', { ascending: false })
    35→        .limit(100);
    36→
    37→      if (sessionsError) {
    38→        console.log('Sessions table error:', sessionsError.message);
    39→      }
    40→
    41→      // Also fetch from legacy analysis_results for backward compatibility
    42→      const { data: legacyData, error: legacyError } = await supabase
    43→        .from('analysis_results')
    44→        .select('*')
    45→        .order('created_at', { ascending: false })
    46→        .limit(50);
    47→
    48→      if (legacyError) {
