    52→      // Combine and deduplicate
    53→      const combined: Session[] = [];
    54→
    55→      // Add sessions
    56→      if (sessionsData) {
    57→        combined.push(...sessionsData);
    58→      }
    59→
    60→      // Add legacy results (convert to Session format)
    61→      if (legacyData) {
    62→        for (const legacy of legacyData) {
    63→          const resultJson = legacy.result_json || {};
