    65→          if (resultJson.session_id && combined.some((s) => s.id === resultJson.session_id)) {
    66→            continue;
    67→          }
    68→          // Check if user_id matches
    69→          if (resultJson.user_id && resultJson.user_id !== user.id) {
    70→            continue;
    71→          }
